ISLAMABAD, Feb 9 (APP): Independent candidate Shah Abu Tarab Khan Bangash has won the Khyber Pakhtunkhwa Assembly election from PK-93 Hangu by securing 31,136 votes.
According to the unofficial result issued by the Returning Officer/ECP, his runner-up was an Independent candidate Atiq Ur Rehman who bagged 14,006 votes. Overall votersâ€™ turn-out remained 24.96 per cent.
